import React from "react";
import "./App.css";
import NavBar from "./components/common/navBar";
import Movies from "./components/movies";

function App() {
  return (
    <div>
      <NavBar />
      <div className="container">
        <Movies />
      </div>
    </div>
  );
}

export default App;
